    [],nt"num_tags": 14,nt"name": "currituck-national-wildlife-refuge-annual-narrative-report-calendar-year-1992",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Currituck National
    Wildlife Refuge summarizes refuge activities for calendar year 1992. The report
    begins with a summary of weather and habitat conditions during the period. A planning
    section outlines refuge management plans, public participation, compliance mandates,
    and scientific research. The administration section discusses personnel actions,
    refuge programs, and safety. The habitat management section provides information
    on croplands, wetlands, wilderness areas, grazing, pest control, and easements for
    waterfowl. A wildlife section covers waterfowl, shorebirds, game mammals, fisheries
    resources, banding, animal control, and endangered and threatened species. The public
    use section outlines interpretive programs, recreational use, refuge visitation,
    hunting, and law enforcement. An equipment and facilities section covers new construction,
    maintenance, and communications systems. Items of interest are provided at the end
    of the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
